/**
 * Created by Lenovo on 2019/8/7.
 */
import axios from "axios";
export function getData(method,url,data,successCB,failCB){
    axios({
        method: method,
        url: url,
        data: data
    }).then(function (res) {
        if(successCB){
            successCB(res.data);
            console.log(res.data);
        }
    }).catch(function (err) {
        if(failCB){
            failCB(err);
            console.log(err);
        }
    });
}
export function isDefine() {

}
export function goNext(that,pathname,state) {
    if(state){
        that.props.history.push({pathname:pathname,state:state});
    }else {
        that.props.history.push(pathname);
    }
}
export function setState(that,state) {
    that.setState(state)
}
